		if(RefConfig01_source_selector == "digital input")
		{
			write(RefConfig01, 0x82);
		}
		else if(RefConfig01_source_selector == "R input")
		{
			write(RefConfig01, 0x84);
		}
		else if(RefConfig01_source_selector == "digital input ext")
		{
			write(RefConfig01, 0x86);
		}
	}
	else if(RefConfig01_selector == "pos. edge")
	{
		if(RefConfig01_source_selector == "digital input")
		{
			write(RefConfig01, 0x83);
		}
		else if(RefConfig01_source_selector == "R input")
		{
			write(RefConfig01, 0x85);
		}
		else if(RefConfig01_source_selector == "digital input ext")
		{
			write(RefConfig01, 0x87);
		}
	}
	else if(RefConfig01_selector == "unconditional")
	{
		write(RefConfig01, 0x80);
	}
	if(RefConfig02_selector == "neg. edge")
	{
		if(RefConfig02_source_selector == "digital input")
		{
			write(RefConfig02, 0x82);
		}
		else if(RefConfig02_source_selector == "R input")
		{
			write(RefConfig02, 0x84);
		}
		else if(RefConfig02_source_selector == "digital input ext")
		{
			write(RefConfig02, 0x86);
		}
	}
	else if(RefConfig02_selector == "pos. edge")
	{
		if(RefConfig02_source_selector == "digital input")
		{
			write(RefConfig02, 0x83);
		}
		else if(RefConfig02_source_selector == "R input")
		{
			write(RefConfig02, 0x85);
		}
		else if(RefConfig02_source_selector == "digital input ext")
		{
			write(RefConfig02, 0x87);
		}
	}
	else if(RefConfig02_selector == "unconditional")
	{
		write(RefConfig02, 0x80);
	}
	write(GeneralConfig01, 0x00
	| EnhancedControlword01=="on" ? 0x01 : 0x00
	| MPGenCycleIdx01=="10ms" ? 0x02 : 0x00
	| MPGenCycleIdx01=="5ms" ? 0x04 : 0x00 );
	write(LimitSwitchConfig01, 0x00
	| NegLimitSwitch01=="low_active" ? 0x01 : 0x00
	| NegLimitSwitch01=="high_active" ? 0x03 : 0x00
	| PosLimitSwitch01=="low_active" ? 0x04 : 0x00
	| PosLimitSwitch01=="high_active" ? 0x0C : 0x00
	| DirectionControl01=="on" ? 0x80 : 0x00 );
	write(PositionLimitMin01, PositionLimitMin01);
	write(PositionLimitMax01, PositionLimitMax01);
	write(LimitSwitchConfig02, 0x00
	| NegLimitSwitch02=="low_active" ? 0x01 : 0x00
	| NegLimitSwitch02=="high_active" ? 0x03 : 0x00
	| PosLimitSwitch02=="low_active" ? 0x04 : 0x00
	| PosLimitSwitch02=="high_active" ? 0x0C : 0x00
	| DirectionControl02=="on" ? 0x80 : 0x00 );
	write(PositionLimitMin02, PositionLimitMin02);
	write(PositionLimitMax02, PositionLimitMax02);
	write(BrakeConfig01, 0x00
	| BrakeConfig01=="Motor1" ? 0x01 : 0x00
	| BrakeConfig01=="Motor2" ? 0x02 : 0x00
	);
	write(TempEncLimit01, TempEncLimit01);
	write(TempEncLimit02, TempEncLimit02);
}
